import React, { useState } from 'react';

const Menu = () => {
    const [submenuVisible, setSubmenuVisible] = useState(false);

    const toggleSubmenu = () => {
        setSubmenuVisible(!submenuVisible);
    };

    return (
        <div className="bg-menu">
            <div className="container">
                <nav className="menu-lateral">
                    <ul>
                        <li className="item-menu" onClick={toggleSubmenu}>
                            Dashboard
                            {submenuVisible && (
                                <ul className="submenu">
                                    <li className="item-menu">Dashboard 1.1</li>
                                    {submenuVisible && (
                                    <ul className="submenu">
                                        <li>Subitem1.1.1</li>
                                    </ul>
                                    )}
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
        </div>
    );
};

export default Menu;
